import './Registeration.css';

function Registeration(props) {
    const SignIn = () => {
        props.IsRegister("SignIn")
    }

    return (
        <form action="action_page.php" class="form">
            <div class="container">
                <h1>Register</h1>
                <p>Please fill in this form to create an account.</p>

                <label for="email"><b>{props.Email}</b></label>
                <input type="text" placeholder={props.Email} name="email" id="email" required></input>

                <label for="psw"><b>Password</b></label>
                <input type="password" placeholder="Enter Password" name="psw" id="psw" required></input>

                <label for="psw-repeat"><b>Repeat Password</b></label>
                <input type="password" placeholder="Repeat Password" name="psw-repeat" id="psw-repeat" required></input>

                <p>By creating an account you agree to our <a href="#">Terms & Privacy</a>.</p>
                <input type="Submit" Value="Register" ></input>
            </div>
            <div class="container signin">
                <p>Already have an account? <a href="#" onClick={SignIn}>Sign in</a>.</p>
            </div>
        </form>
    );
}
export default Registeration;
